import React, { Component } from 'react'

import '../../../src/styles.css'

import {
  StyledContainer,
  HeaderContainer,
  MenuBar,
  UnorderedList,
  List
} from './styled'

export default class Menu extends Component {
  render() {
    return (
      <StyledContainer>
        <HeaderContainer>
          <UnorderedList>
            <List>Expenses</List>
            <List>Graphics</List>
            <List>Tips</List>
          </UnorderedList>
        </HeaderContainer>
      </StyledContainer>
    )
  }
}
